query:
/*+ NoMergeJoin(mi_idx t) NoNestLoop(mi_idx t mk) */ select count(*)
from movie_info_idx AS mi_idx
inner join title AS t
on t.id = mi_idx.movie_id AND mi_idx.info_type_id = 99 AND t.kind_id < 7 AND t.production_year < 2007
inner join movie_keyword AS mk
on t.id = mk.movie_id AND mk.keyword_id < 5982;
